import React, { useState, useEffect } from "react";
import "./styles/App.css";


function App() {
    return (
        <div>
            <h1>Welcome to Barangay App</h1>
            <p>This is where you will build your UI.</p>
            <button onClick={() => alert("Button Clicked!")}>Click Me</button>
        </div>
    );
}

export default App;
